	module.exports = {"data":{"site":{"siteMetadata":{"title":"Annalisa Valente"}},"contentfulPageSelectorPanel":{"pages":[{"name":"Macmillan Cancer Support","title":null,"slug":"/projects/brave-the-shave/","description":"Redesigning Brave the Shave microsite"},{"name":"Google","title":"Google","slug":"/projects/google/","description":"Interaction designer contractor in the Google Play Console team"},{"name":"The Telegraph","title":"The Telegraph","slug":"/projects/the-telegraph/","description":"Working on various digital newspaper touch points"},{"name":"Nectar ","title":"Nectar","slug":"/projects/nectar/","description":"  New way of discovering Nectar brands for web and iOS-Android "},{"name":"The Telegraph puzzle ","title":null,"slug":"/projects/the-telegraph-puzzle/","description":"Redesign the experience of the Telegraph puzzle website"},{"name":"Remember names","title":null,"slug":"/projects/face-name/","description":"Concept of an Android experience that helps to match faces to names"},{"name":"MyMail & Nectar","title":"MyMail & Nectar","slug":"/projects/mymail-and-nectar/","description":"Launch of MyMail and Nectar proposition"},{"name":"Local Cancer Intelligence","title":"Local Cancer Intelligence","slug":"/projects/local-cancer-intelligence/","description":"New filter system for the LCI website"},{"name":"Mindfulness Moments","title":"Mindfulness Moments","slug":"/projects/mindfulness-moments/","description":"Building a new fundraising proposition"},{"name":"Mighty hikes","title":null,"slug":"/projects/mighty-hikes","description":"Building a new fundraising proposition"},{"name":"Calvin Klein","title":"Calvin Klein","slug":"/projects/calvin-klein/","description":"Designing microsite for Calvin Klein Italy"},{"name":"Emoji and depression","title":null,"slug":"/projects/emoji-and-depression","description":"Detect depression in young people "}]},"contentfulPage":{"slug":"/projects/local-cancer-intelligence/","password":null,"panels":[{"__typename":"ContentfulHeaderPanel","text":"Local Cancer Intelligence"},{"__typename":"ContentfulContentPanel","content":{"content":"__My role:__ UX Lead\n\n__Project scope:__ Local Cancer Intelligence helps professionals understand the changing cancer population within a Clinical Commissioning Group (CCG) in England. It also shows how this compares within Cancer Alliances for some of the data sets available on the tool.\n\nUsers struggling to use the filters. In order to help them to find easily what they are looking for we have to improve the usability of the filter functionality, make it simple and improve the sorting.\n\n__Approach__\n\nI've worked with the stakeholders to improve the search and filters to improve the usability of the website on desktop and mobile.\n\nAfter design exploration workshops I've created a new proposal with [principle](http://principleformac.com/) to test. I've made a prototype and I've conducted usability test with 7 people between students and NHS professionals. The users had positive feedback regarding the new interactions and search. ","childMarkdownRemark":{"html":"<p><strong>My role:</strong> UX Lead</p>\n<p><strong>Project scope:</strong> Local Cancer Intelligence helps professionals understand the changing cancer population within a Clinical Commissioning Group (CCG) in England. It also shows how this compares within Cancer Alliances for some of the data sets available on the tool.</p>\n<p>Users struggling to use the filters. In order to help them to find easily what they are looking for we have to improve the usability of the filter functionality, make it simple and improve the sorting.</p>\n<p><strong>Approach</strong></p>\n<p>I've worked with the stakeholders to improve the search and filters to improve the usability of the website on desktop and mobile.</p>\n<p>After design exploration workshops I've created a new proposal with <a href=\"http://principleformac.com/\">principle</a> to test. I've made a prototype and I've conducted usability test with 7 people between students and NHS professionals. The users had positive feedback regarding the new interactions and search. </p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/BxKGSpTdxcU5VubPfsPt5/e6c00a9dca909e462e38d2daca6b4ca0/Screen_Shot_2019-02-12_at_00.22.06.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/6XueQSipkQSTNTO6c4GLml/d70cbaa4f64d3e11160fa353a98f3585/Screen_Shot_2019-02-12_at_00.22.13.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3FN94wl2rfIoEaUhKUcOVk/4c37d64a1367a538f5c9e2580c802f15/Screen_Shot_2019-02-12_at_00.22.38.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":false,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/xh3STcVBKKcGWaMK6WYUc/ff37cd1d3fdb144972c546fcc7dac62b/lci.gif"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/vodbWXXo6GaAU8OOeheX3/aff9155ed7390c86eb8bdac02a00b346/Screen_Shot_2019-02-12_at_00.22.23.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/2L02zpY01SFLlh8V5dwKzY/8c5372c25b3446113cf8bcb9a1ee53c0/Screen_Shot_2019-02-12_at_00.27.44.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/4PVls68tnGXeYRKUlIqcdA/0010a26f1690c213a24ccba8880019e2/Screen_Shot_2019-02-12_at_00.28.16.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"Thanks to an increase of the mobile use from av of 5% up to nearly 30% later in the year, we focused on improving the UX on the mobile experience.","childMarkdownRemark":{"html":"<p>Thanks to an increase of the mobile use from av of 5% up to nearly 30% later in the year, we focused on improving the UX on the mobile experience.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/1QzVRyIYxO02isowGgm8mI/7dc9262ac04dc8d0c34ae6c90a80ddda/mobile.gif"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__User testing__\n\nUnmoderated user testing on the platform whatuserdo\n7 individuals aged between 25 and 50 participated in the study.\n1. All participants were students or researchers.\n2. They are all familiar with Macmillan Cancer Support.\n\nThe participants were introduced the aim of the session, and then asked some questions in relation to the current website\n1. Then, the new prototype with the new design was presented.\n2. Participants were encouraged to think aloud: they were encouraged to say what they were thinking, feeling or doing while interacting with the product.\n","childMarkdownRemark":{"html":"<p><strong>User testing</strong></p>\n<p>Unmoderated user testing on the platform whatuserdo\n7 individuals aged between 25 and 50 participated in the study.</p>\n<ol>\n<li>All participants were students or researchers.</li>\n<li>They are all familiar with Macmillan Cancer Support.</li>\n</ol>\n<p>The participants were introduced the aim of the session, and then asked some questions in relation to the current website</p>\n<ol>\n<li>Then, the new prototype with the new design was presented.</li>\n<li>Participants were encouraged to think aloud: they were encouraged to say what they were thinking, feeling or doing while interacting with the product.</li>\n</ol>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/7HrrzBrt1FiKbh1kiNmoKA/11bffd04cfc8f2a971f7dacc51b0dcf5/Screen_Shot_2019-02-12_at_00.30.53.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Result__\n\n1. 7 participants could complete the tasks\n2. 7 participants could reset the filters with no hesitation and deviation.\n3. 6 participants find the filters clear and easier to use.","childMarkdownRemark":{"html":"<p><strong>Result</strong></p>\n<ol>\n<li>7 participants could complete the tasks</li>\n<li>7 participants could reset the filters with no hesitation and deviation.</li>\n<li>6 participants find the filters clear and easier to use.</li>\n</ol>"}}}]}},"pathContext":{"slug":"/projects/local-cancer-intelligence/","p":"35675e68f4b5af7b995d9205ad0fc43842f16450"}}

