	module.exports = {"data":{"site":{"siteMetadata":{"title":"Annalisa Valente"}},"contentfulPageSelectorPanel":{"pages":[{"name":"Macmillan Cancer Support","title":null,"slug":"/projects/brave-the-shave/","description":"Redesigning Brave the Shave microsite"},{"name":"Google","title":"Google","slug":"/projects/google/","description":"Interaction designer contractor in the Google Play Console team"},{"name":"The Telegraph","title":"The Telegraph","slug":"/projects/the-telegraph/","description":"Working on various digital newspaper touch points"},{"name":"Nectar ","title":"Nectar","slug":"/projects/nectar/","description":"  New way of discovering Nectar brands for web and iOS-Android "},{"name":"The Telegraph puzzle ","title":null,"slug":"/projects/the-telegraph-puzzle/","description":"Redesign the experience of the Telegraph puzzle website"},{"name":"Remember names","title":null,"slug":"/projects/face-name/","description":"Concept of an Android experience that helps to match faces to names"},{"name":"MyMail & Nectar","title":"MyMail & Nectar","slug":"/projects/mymail-and-nectar/","description":"Launch of MyMail and Nectar proposition"},{"name":"Local Cancer Intelligence","title":"Local Cancer Intelligence","slug":"/projects/local-cancer-intelligence/","description":"New filter system for the LCI website"},{"name":"Mindfulness Moments","title":"Mindfulness Moments","slug":"/projects/mindfulness-moments/","description":"Building a new fundraising proposition"},{"name":"Mighty hikes","title":null,"slug":"/projects/mighty-hikes","description":"Building a new fundraising proposition"},{"name":"Calvin Klein","title":"Calvin Klein","slug":"/projects/calvin-klein/","description":"Designing microsite for Calvin Klein Italy"},{"name":"Emoji and depression","title":null,"slug":"/projects/emoji-and-depression","description":"Detect depression in young people "}]},"contentfulPage":{"slug":"/projects/the-telegraph-puzzle/","password":null,"panels":[{"__typename":"ContentfulHeaderPanel","text":"The Telegraph puzzle website"},{"__typename":"ContentfulContentPanel","content":{"content":"__My role:__ UX Designer\n\n__Projects:__ Puzzle website. More info [here](https://www.telegraph.co.uk/news/0/telegraph-puzzles-changing/)\nThe website is now [live](https://puzzles.telegraph.co.uk/)\n\n__Business objectives__\n\n1) Make the Puzzles site a more consistent and solid part of the subscription package.\n\n2) Improve our subscriptions offering and reduce churn\n\n3) Make the puzzle website responsive\n\n__UX objectives__\n\n1) Gather feedback on the current Puzzles website\n\n2) Find out what people enjoy, what games they like, how we can make it better\n\n3) Look at competitor Puzzles websites to gain inspiration / ideas (through user testing and landscape review)\n","childMarkdownRemark":{"html":"<p><strong>My role:</strong> UX Designer</p>\n<p><strong>Projects:</strong> Puzzle website. More info <a href=\"https://www.telegraph.co.uk/news/0/telegraph-puzzles-changing/\">here</a>\nThe website is now <a href=\"https://puzzles.telegraph.co.uk/\">live</a></p>\n<p><strong>Business objectives</strong></p>\n<ol>\n<li>\n<p>Make the Puzzles site a more consistent and solid part of the subscription package.</p>\n</li>\n<li>\n<p>Improve our subscriptions offering and reduce churn</p>\n</li>\n<li>\n<p>Make the puzzle website responsive</p>\n</li>\n</ol>\n<p><strong>UX objectives</strong></p>\n<ol>\n<li>\n<p>Gather feedback on the current Puzzles website</p>\n</li>\n<li>\n<p>Find out what people enjoy, what games they like, how we can make it better</p>\n</li>\n<li>\n<p>Look at competitor Puzzles websites to gain inspiration / ideas (through user testing and landscape review)</p>\n</li>\n</ol>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/6Lnrljj7oIAqwIUqqgIWW2/c491743192c483dcc51de35e4a4cb065/Puzzles_Site_redesign.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__What we did__\n\n1) UX design, building and testing of new proposals\n2) New modern layout, optimised for viewing on mobile devices and tablets\n4) Improved leaderboards and sharing experience\n\n","childMarkdownRemark":{"html":"<p><strong>What we did</strong></p>\n<ol>\n<li>UX design, building and testing of new proposals</li>\n<li>New modern layout, optimised for viewing on mobile devices and tablets</li>\n<li>Improved leaderboards and sharing experience</li>\n</ol>"}}},{"__typename":"ContentfulImagePanel","fullWidth":false,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3iJnqhuBlS0sEYU8gykucA/97e4686a02c290b951e5083c8d875e69/Screen_Shot_2018-11-04_at_21.54.21.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":false,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/IaKVurkmGGOYuA0KSmcca/b46e91b094525d069625b40cf25f8c12/Screen_Shot_2018-11-04_at_21.55.33.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":false,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3zKIm6BsVaWwsKuOscAYYg/9511b851cde5b63b12ffa3ed209f76c0/Screen_Shot_2018-11-04_at_21.58.13.png"}}},{"__typename":"ContentfulContentPanel","content":null}]}},"pathContext":{"slug":"/projects/the-telegraph-puzzle/","p":"35675e68f4b5af7b995d9205ad0fc43842f16450"}}

