	module.exports = {"data":{"site":{"siteMetadata":{"title":"Annalisa Valente"}},"contentfulPageSelectorPanel":{"pages":[{"name":"Macmillan Cancer Support","title":null,"slug":"/projects/brave-the-shave/","description":"Redesigning Brave the Shave microsite"},{"name":"Google","title":"Google","slug":"/projects/google/","description":"Interaction designer contractor in the Google Play Console team"},{"name":"The Telegraph","title":"The Telegraph","slug":"/projects/the-telegraph/","description":"Working on various digital newspaper touch points"},{"name":"Nectar ","title":"Nectar","slug":"/projects/nectar/","description":"  New way of discovering Nectar brands for web and iOS-Android "},{"name":"The Telegraph puzzle ","title":null,"slug":"/projects/the-telegraph-puzzle/","description":"Redesign the experience of the Telegraph puzzle website"},{"name":"Remember names","title":null,"slug":"/projects/face-name/","description":"Concept of an Android experience that helps to match faces to names"},{"name":"MyMail & Nectar","title":"MyMail & Nectar","slug":"/projects/mymail-and-nectar/","description":"Launch of MyMail and Nectar proposition"},{"name":"Local Cancer Intelligence","title":"Local Cancer Intelligence","slug":"/projects/local-cancer-intelligence/","description":"New filter system for the LCI website"},{"name":"Mindfulness Moments","title":"Mindfulness Moments","slug":"/projects/mindfulness-moments/","description":"Building a new fundraising proposition"},{"name":"Mighty hikes","title":null,"slug":"/projects/mighty-hikes","description":"Building a new fundraising proposition"},{"name":"Calvin Klein","title":"Calvin Klein","slug":"/projects/calvin-klein/","description":"Designing microsite for Calvin Klein Italy"},{"name":"Emoji and depression","title":null,"slug":"/projects/emoji-and-depression","description":"Detect depression in young people "}]},"contentfulPage":{"slug":"/projects/mighty-hikes","password":null,"panels":[{"__typename":"ContentfulContentPanel","content":{"content":"__My role:__ UX Lead\n\n__Project scope:__ \nMighty Hikes is a series of one-day hiking marathons all over the UK to raise money for people effected by cancer.\nCurrently there is not a dedicated website and the project scope is to identify opportunity for design and the real needs of partecipants.\n\n- Create a single touchpoint where collect details regarding the series\n- An audit and analysis of the Mighty hikes journey from awareness through to registration completion\n\n __Project objectives:__\n- Improve taxonomy and content of the site based on identifying user needs\n- Improve navigation and flow\n- Improve content on landing pages and single event pages\n- Improve logic of FAQs\n- Create a starting point where to iterate following by appropriate user research:\n 1. Make registration of individual and team in one single platform\n 2. Gamification and challenge (e.g. Go sober)\n 3. Sign up/Donation journey in a single touchpoint\n\n\n__Approach__","childMarkdownRemark":{"html":"<p><strong>My role:</strong> UX Lead</p>\n<p><strong>Project scope:</strong>\nMighty Hikes is a series of one-day hiking marathons all over the UK to raise money for people effected by cancer.\nCurrently there is not a dedicated website and the project scope is to identify opportunity for design and the real needs of partecipants.</p>\n<ul>\n<li>Create a single touchpoint where collect details regarding the series</li>\n<li>An audit and analysis of the Mighty hikes journey from awareness through to registration completion</li>\n</ul>\n<p> <strong>Project objectives:</strong></p>\n<ul>\n<li>Improve taxonomy and content of the site based on identifying user needs</li>\n<li>Improve navigation and flow</li>\n<li>Improve content on landing pages and single event pages</li>\n<li>Improve logic of FAQs</li>\n<li>Create a starting point where to iterate following by appropriate user research:</li>\n<li>Make registration of individual and team in one single platform</li>\n<li>Gamification and challenge (e.g. Go sober)</li>\n<li>Sign up/Donation journey in a single touchpoint</li>\n</ul>\n<p><strong>Approach</strong></p>"}}},{"__typename":"ContentfulHeaderPanel","text":null},{"__typename":"ContentfulContentPanel","content":{"content":"__Data, research and findings__\n\nData on Mighty Hikes:","childMarkdownRemark":{"html":"<p><strong>Data, research and findings</strong></p>\n<p>Data on Mighty Hikes:</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/5TkIoZ2ecMqJrJLMqpYvGw/df8be78bd2cdfeaf919924fd72fff393/Screen_Shot_2019-02-04_at_21.43.27.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/47VhVY8EYjCryoH3En4m8e/af08dc7cae864a8ab919f70a3a9adec8/Screen_Shot_2019-02-04_at_21.43.34.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/4e4R8JMDWcGVdGoaPiBncS/749a4c090c9d638002c2e74c799bce84/Screen_Shot_2019-02-04_at_21.43.44.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Competitor research__","childMarkdownRemark":{"html":"<p><strong>Competitor research</strong></p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/BQsX8cTmo2rkw9rfVF5Cy/7146eeb0e3cbe5c477f02c65618e59ad/Screen_Shot_2019-02-04_at_23.05.18.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/62sKpnkDke5uCeZ0hJNckh/d908ef0d28380703997f81ba7aef3b88/Screen_Shot_2019-02-04_at_23.05.33.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Benchmarks analysis:__\n- Divide the content in two different sections: before and after the event\n- Give the right amount of info to register in a simple way\n- Search bar in the homepage to allow to search for an event\n\n__Research and findings__\n\n__Exit quantitative/qualitative surveys:__\nThe survey was sent after the events and it collected around __4.000__ replies from participants.","childMarkdownRemark":{"html":"<p><strong>Benchmarks analysis:</strong></p>\n<ul>\n<li>Divide the content in two different sections: before and after the event</li>\n<li>Give the right amount of info to register in a simple way</li>\n<li>Search bar in the homepage to allow to search for an event</li>\n</ul>\n<p><strong>Research and findings</strong></p>\n<p><strong>Exit quantitative/qualitative surveys:</strong>\nThe survey was sent after the events and it collected around <strong>4.000</strong> replies from participants.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3NB17ExinOUq9LSjiLHcQh/1f86368d2f4fff89ad57e48aa3c26323/Screen_Shot_2019-02-04_at_23.08.10.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Facebook qualitative survey:__\nThe survey was posted in the facebook page of the event and it collected __163 replies__. It covers areas that were not covered with the exit survey to understand user needs and behaviour for subjects like training and after the hike activities.","childMarkdownRemark":{"html":"<p><strong>Facebook qualitative survey:</strong>\nThe survey was posted in the facebook page of the event and it collected <strong>163 replies</strong>. It covers areas that were not covered with the exit survey to understand user needs and behaviour for subjects like training and after the hike activities.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3lUrkPcDUnKQAasqQE0WJo/9c70031d6064db184edfddee37770a6e/Screen_Shot_2019-02-04_at_23.09.52.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Findings from qualitative research__","childMarkdownRemark":{"html":"<p><strong>Findings from qualitative research</strong></p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/6CdhBOnZcJUPQdJVvxNXXA/6ff367dce885b3980695f1da3b6d045d/Screen_Shot_2019-02-04_at_23.13.32.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/18nSOCk3Myqn3jwzpSDwwf/50e8daaf09914b30d3152f8a09641424/Screen_Shot_2019-02-04_at_23.13.49.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3nIalrAScDO7M4zuFv7s6A/1c7684df7376811372fd4be49a9f5c7f/Screen_Shot_2019-02-04_at_23.14.13.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/4yd2c47RoQosFLNypW2Bvp/0a1089a05bd6ceda402469578d6af547/Screen_Shot_2019-02-04_at_23.14.30.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Identifying personas__\nPersonas were built based on data from analytics*, ecosystem ‘fundraiser’ persona Mosaic and Acom marketing segmentation.\n\n**(Evaluation and Analysis of Responders to the exit survey: Jurassic Coast Mighty Hike 2018, Lake District Mighty Hike 2018, Northumberland Coast Mighty Hike, Peak District Mighty Hike 2018, Rob Roy Mighty Hike 2018, South Coast Mighty Hike 2018, Thames Path Mighty Hike 2018, Wye Valley Mighty Hike 2018)*","childMarkdownRemark":{"html":"<p><strong>Identifying personas</strong>\nPersonas were built based on data from analytics*, ecosystem ‘fundraiser’ persona Mosaic and Acom marketing segmentation.</p>\n<p>*<em>(Evaluation and Analysis of Responders to the exit survey: Jurassic Coast Mighty Hike 2018, Lake District Mighty Hike 2018, Northumberland Coast Mighty Hike, Peak District Mighty Hike 2018, Rob Roy Mighty Hike 2018, South Coast Mighty Hike 2018, Thames Path Mighty Hike 2018, Wye Valley Mighty Hike 2018)</em></p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3s1VPRHc72obgzZW5ABdt8/fbef54f601a2daa1ceea585f4c1d0105/146239-OTQQF6-872.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"Based on MH personas we can say that we need to reach the following goals in order to satisfy user needs:\n\n- Show how the events are close to users interests and their personality.\n- Make it clear how the money raised will help people affected by cancer.\n- Show how taking part in the hikes benefits them: e.g. adventure with friends, achievement of a goal etc.\n- Make the registration simple and easy.\n- Add the social part.\n- Simplify the pay in process investigating new ways of pay in (paypal, Monzo?).\n\n__Recommendations and design opportunities__\n\n__Current flow:__","childMarkdownRemark":{"html":"<p>Based on MH personas we can say that we need to reach the following goals in order to satisfy user needs:</p>\n<ul>\n<li>Show how the events are close to users interests and their personality.</li>\n<li>Make it clear how the money raised will help people affected by cancer.</li>\n<li>Show how taking part in the hikes benefits them: e.g. adventure with friends, achievement of a goal etc.</li>\n<li>Make the registration simple and easy.</li>\n<li>Add the social part.</li>\n<li>Simplify the pay in process investigating new ways of pay in (paypal, Monzo?).</li>\n</ul>\n<p><strong>Recommendations and design opportunities</strong></p>\n<p><strong>Current flow:</strong></p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3qmHi3qHDqNYew3qe2ywSY/43a347b3089db9976e98debf62b08f11/Screen_Shot_2019-02-04_at_23.31.57.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3MUINdbttMcEvTVZAb3B7X/0a6bdebeee82a069946864e3384c68b0/Screen_Shot_2019-02-04_at_23.32.09.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/50ifr0cvMJ8MjVcSmmFvwQ/86af70b0f1b534bc9d6b993c3d27dfc7/Screen_Shot_2019-02-04_at_23.32.18.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/2Y0OuRFB3Xr3B9qiYcZi1b/c7d7d2b035198583174e99ab02655bff/Screen_Shot_2019-02-04_at_23.32.26.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__New flow proposal and key insights__","childMarkdownRemark":{"html":"<p><strong>New flow proposal and key insights</strong></p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/2zGdDOMUd91orVbLPmDEZI/152dbe80059e5a952b6aca75cd72a0ae/Screen_Shot_2019-02-04_at_23.38.54.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/6a3B95wItw6Bz1lXu8aFha/cc0e9a4dbfa72da04e1a3a124d3d3c36/Screen_Shot_2019-02-04_at_23.39.07.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/x9dRoDcQY4uRXQ2eR8xcB/615db41821d6c6ea60296b66d3c95717/Screen_Shot_2019-02-04_at_23.39.30.png"}}}]}},"pathContext":{"slug":"/projects/mighty-hikes","p":"35675e68f4b5af7b995d9205ad0fc43842f16450"}}

