	module.exports = {"data":{"site":{"siteMetadata":{"title":"Annalisa Valente"}},"contentfulPageSelectorPanel":{"pages":[{"name":"Macmillan Cancer Support","title":null,"slug":"/projects/brave-the-shave/","description":"Redesigning Brave the Shave microsite"},{"name":"Google","title":"Google","slug":"/projects/google/","description":"Interaction designer contractor in the Google Play Console team"},{"name":"The Telegraph","title":"The Telegraph","slug":"/projects/the-telegraph/","description":"Working on various digital newspaper touch points"},{"name":"Nectar ","title":"Nectar","slug":"/projects/nectar/","description":"  New way of discovering Nectar brands for web and iOS-Android "},{"name":"The Telegraph puzzle ","title":null,"slug":"/projects/the-telegraph-puzzle/","description":"Redesign the experience of the Telegraph puzzle website"},{"name":"Remember names","title":null,"slug":"/projects/face-name/","description":"Concept of an Android experience that helps to match faces to names"},{"name":"MyMail & Nectar","title":"MyMail & Nectar","slug":"/projects/mymail-and-nectar/","description":"Launch of MyMail and Nectar proposition"},{"name":"Local Cancer Intelligence","title":"Local Cancer Intelligence","slug":"/projects/local-cancer-intelligence/","description":"New filter system for the LCI website"},{"name":"Mindfulness Moments","title":"Mindfulness Moments","slug":"/projects/mindfulness-moments/","description":"Building a new fundraising proposition"},{"name":"Mighty hikes","title":null,"slug":"/projects/mighty-hikes","description":"Building a new fundraising proposition"},{"name":"Calvin Klein","title":"Calvin Klein","slug":"/projects/calvin-klein/","description":"Designing microsite for Calvin Klein Italy"},{"name":"Emoji and depression","title":null,"slug":"/projects/emoji-and-depression","description":"Detect depression in young people "}]},"contentfulPage":{"slug":"/projects/mymail-and-nectar/","password":null,"panels":[{"__typename":"ContentfulHeaderPanel","text":"MyMail in partnership with Nectar"},{"__typename":"ContentfulContentPanel","content":{"content":"__Role:__ UX designer\n\n<br/> __The project:__ Launch of MyMail in partnership with Nectar\n\nThe Daily Mail is the UK’s most widely read national newspaper and one of the top online news destinations. My Mail is the loyalty scheme of the Daily Mail. They chose to partner with Nectar to increase their competitive advantage and drive growth by focusing on customer loyalty.\n\n\nCollaborating directly with the Daily mail internal design team on a large redesign, our team could dedicate fully to the new journey.\n\n\n","childMarkdownRemark":{"html":"<p><strong>Role:</strong> UX designer</p>\n<p><br/> <strong>The project:</strong> Launch of MyMail in partnership with Nectar</p>\n<p>The Daily Mail is the UK’s most widely read national newspaper and one of the top online news destinations. My Mail is the loyalty scheme of the Daily Mail. They chose to partner with Nectar to increase their competitive advantage and drive growth by focusing on customer loyalty.</p>\n<p>Collaborating directly with the Daily mail internal design team on a large redesign, our team could dedicate fully to the new journey.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"MyMail Nectar Customer Proposition","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3WtE0WMtDqUk6ck0uAMAiE/d099eff8cc475bf3ba9d3e0640e3e27d/MyMail_Nectar_Customer_Proposition_copy.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Fast prototyping and early testing__\n\nTo prove a set of navigational hypothesis and overall journey flows, we organise a very early user testing with a couple of rough prototypes.\n","childMarkdownRemark":{"html":"<p><strong>Fast prototyping and early testing</strong></p>\n<p>To prove a set of navigational hypothesis and overall journey flows, we organise a very early user testing with a couple of rough prototypes.</p>"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__General requirements:__\n\nBy linking their My Mail and Nectar card accounts, users will be able to collect Nectar points for every Daily Mail and Mail on Sunday newspaper they buy.\n\n__Goals and user scenarios:__","childMarkdownRemark":{"html":"<p><strong>General requirements:</strong></p>\n<p>By linking their My Mail and Nectar card accounts, users will be able to collect Nectar points for every Daily Mail and Mail on Sunday newspaper they buy.</p>\n<p><strong>Goals and user scenarios:</strong></p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/4su6kMGd7yGYk6W2YY6AAo/1717605c18a02ea3c380665c1cfc9310/Screen_Shot_2018-11-15_at_07.44.10.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/69RSakRFtY0GYWcoQSKyKI/c812a5a35d1d6ae5897a3d5cfc6d78cd/Screen_Shot_2018-11-15_at_07.36.58.png"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Key findings__\n\nAfter a few iterations and various user testing  with the daily mail design team, a report of findings was produced and a plan was put in place for going forward. Some of the most important insights we had from the users:\n\n- Most of them were positive towards the My Mail+Nectar proposition \n- Positive towards the linking journey\n- Positive towards the usability\n\nSome amends were definite and didn't need further investigation and some we put into an MVT roadmap to gain more insight.\n\nThe project went <a href=\"https://www.mymail.co.uk/home\" target=\"_blank\" title=\"External link to MyMail\">live</a> in August '17 ","childMarkdownRemark":{"html":"<p><strong>Key findings</strong></p>\n<p>After a few iterations and various user testing  with the daily mail design team, a report of findings was produced and a plan was put in place for going forward. Some of the most important insights we had from the users:</p>\n<ul>\n<li>Most of them were positive towards the My Mail+Nectar proposition </li>\n<li>Positive towards the linking journey</li>\n<li>Positive towards the usability</li>\n</ul>\n<p>Some amends were definite and didn't need further investigation and some we put into an MVT roadmap to gain more insight.</p>\n<p>The project went <a href=\"https://www.mymail.co.uk/home\" target=\"_blank\" title=\"External link to MyMail\">live</a> in August '17 </p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/61Qdmeuq25fJbhoFKP3vC0/c6d75b76bef43278a4731d1f6982268a/Screen_Shot_2019-01-31_at_10.08.02.png"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/59sNZnctbO0iYkimYQaiq8/c232ae50e6c3b1318d2c3275dbdb54b0/Desktop.jpg"}}}]}},"pathContext":{"slug":"/projects/mymail-and-nectar/","p":"35675e68f4b5af7b995d9205ad0fc43842f16450"}}

