	module.exports = {"data":{"site":{"siteMetadata":{"title":"Annalisa Valente"}},"contentfulPageSelectorPanel":{"pages":[{"name":"Macmillan Cancer Support","title":null,"slug":"/projects/brave-the-shave/","description":"Redesigning Brave the Shave microsite"},{"name":"Google","title":"Google","slug":"/projects/google/","description":"Interaction designer contractor in the Google Play Console team"},{"name":"The Telegraph","title":"The Telegraph","slug":"/projects/the-telegraph/","description":"Working on various digital newspaper touch points"},{"name":"Nectar ","title":"Nectar","slug":"/projects/nectar/","description":"  New way of discovering Nectar brands for web and iOS-Android "},{"name":"The Telegraph puzzle ","title":null,"slug":"/projects/the-telegraph-puzzle/","description":"Redesign the experience of the Telegraph puzzle website"},{"name":"Remember names","title":null,"slug":"/projects/face-name/","description":"Concept of an Android experience that helps to match faces to names"},{"name":"MyMail & Nectar","title":"MyMail & Nectar","slug":"/projects/mymail-and-nectar/","description":"Launch of MyMail and Nectar proposition"},{"name":"Local Cancer Intelligence","title":"Local Cancer Intelligence","slug":"/projects/local-cancer-intelligence/","description":"New filter system for the LCI website"},{"name":"Mindfulness Moments","title":"Mindfulness Moments","slug":"/projects/mindfulness-moments/","description":"Building a new fundraising proposition"},{"name":"Mighty hikes","title":null,"slug":"/projects/mighty-hikes","description":"Building a new fundraising proposition"},{"name":"Calvin Klein","title":"Calvin Klein","slug":"/projects/calvin-klein/","description":"Designing microsite for Calvin Klein Italy"},{"name":"Emoji and depression","title":null,"slug":"/projects/emoji-and-depression","description":"Detect depression in young people "}]},"contentfulPage":{"slug":"/projects/brave-the-shave/","password":"password1","panels":[{"__typename":"ContentfulHeaderPanel","text":"Brave the shave, Macmillan Cancer Support"},{"__typename":"ContentfulContentPanel","content":{"content":"__My role:__ UX Lead\n\n__The project:__ Across the UK, thousands of people are getting sponsored to shave their hair for Macmillan Cancer Support. Brave shavers have raised over £16.8 million. I worked on the Brave the shave website which is currently <a title=\"External link to Brave the Shave\" href=\"https://bravetheshave.macmillan.org.uk/\" target=\"_blank\">live</a>.\n\n__Project scope:__ \n- Allow user to create a profile: increase user registrations\n- Onboarding: reduce friction between shaver and donor experience\n- Help and support journey: solving the problem of the increase of emails to the support team\n\n__Competitor analisys__\n\nTop 9 Fundraising Event List\n\n\n","childMarkdownRemark":{"html":"<p><strong>My role:</strong> UX Lead</p>\n<p><strong>The project:</strong> Across the UK, thousands of people are getting sponsored to shave their hair for Macmillan Cancer Support. Brave shavers have raised over £16.8 million. I worked on the Brave the shave website which is currently <a title=\"External link to Brave the Shave\" href=\"https://bravetheshave.macmillan.org.uk/\" target=\"_blank\">live</a>.</p>\n<p><strong>Project scope:</strong> </p>\n<ul>\n<li>Allow user to create a profile: increase user registrations</li>\n<li>Onboarding: reduce friction between shaver and donor experience</li>\n<li>Help and support journey: solving the problem of the increase of emails to the support team</li>\n</ul>\n<p><strong>Competitor analisys</strong></p>\n<p>Top 9 Fundraising Event List</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":null,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/5ip2iHZlgQuIgcOQmwKc2o/20c214c105f79223a767dbb2a6df8c63/Artboard.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__What we know about the users__\n\n__Why do people donate?__ \n\nClassifying a difference between donor and fundraiser helped us to define the two main journeys on the website.\n\nI've created personas based on data, demographics, marketing segmentations and research.\n\nI also arranged focus groups with fundraisers who took part in fundraising campaigns in the past years; this helped us to understand users perceptions.","childMarkdownRemark":{"html":"<p><strong>What we know about the users</strong></p>\n<p><strong>Why do people donate?</strong> </p>\n<p>Classifying a difference between donor and fundraiser helped us to define the two main journeys on the website.</p>\n<p>I've created personas based on data, demographics, marketing segmentations and research.</p>\n<p>I also arranged focus groups with fundraisers who took part in fundraising campaigns in the past years; this helped us to understand users perceptions.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/7wAEkuGY6c8yaIAAGUuw6E/993a8728e4c65598ffb8f05ed66d0ef4/A7.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/4peH08xJEca0KieO2i8Sqm/d0631b0139b08af5fed562813c76851d/A8.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/6QQx3k4FpuIue4UCmEgyIY/afc7c2afef91ceab59097dda10c28a08/411124-PDVE7E-661.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3cGUjvZRYs22Uq8cOcS66O/c171f8fd2348c33fefe1d841077476b5/A9.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Design plan__\n\nWorking with the stakeholders and the various teams I helped to create timelines and backlogs to coordinate the work with the rest of the company. This involved UI designers, marketing managers, product owners etc.","childMarkdownRemark":{"html":"<p><strong>Design plan</strong></p>\n<p>Working with the stakeholders and the various teams I helped to create timelines and backlogs to coordinate the work with the rest of the company. This involved UI designers, marketing managers, product owners etc.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/5OQBKMWyR2we86AEiCuows/ebc63fcb7c5d955dc706181fc4bcf3f6/A5.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/5YLnAKQ0fucWuyUcsGkKY8/ca9d75e136810aa724a77be315f10625/A4.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/1dJ2lQc2ueQoM86S8YUISG/c009fcdb82d29bedb69269b171b806f1/A9.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Prototype and user testing__\n\nI made two prototypes, tested them with existing users and new potential users. I then created presentations with all the findings: this helped the teams to understand the users needs and to priorities the future features that needed to be built.","childMarkdownRemark":{"html":"<p><strong>Prototype and user testing</strong></p>\n<p>I made two prototypes, tested them with existing users and new potential users. I then created presentations with all the findings: this helped the teams to understand the users needs and to priorities the future features that needed to be built.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/45TCcwfHRmUEsAcsE4sim0/5e6483c9d6200bdb1b4fb69123dc53fb/feee.gif"}}},{"__typename":"ContentfulContentPanel","content":{"content":"Following the conclusion of the various testing, I iterated the UX based on the findings and I worked closely with the rest of the teams like social media team and digital editors to ensure the delivery of a consistent user experience across all the platforms.\n\nI constantly supported the dev team from the start of the project to ensure consideration with the technical constraints upfront and to develop the project in the required time reaching the milestones.\n","childMarkdownRemark":{"html":"<p>Following the conclusion of the various testing, I iterated the UX based on the findings and I worked closely with the rest of the teams like social media team and digital editors to ensure the delivery of a consistent user experience across all the platforms.</p>\n<p>I constantly supported the dev team from the start of the project to ensure consideration with the technical constraints upfront and to develop the project in the required time reaching the milestones.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//downloads.ctfassets.net/wk0hltq7eofw/1yLMrQ6ywwMamkQCWWIEyC/ec0f30d6e3116d49fd761f0876af82ac/Artboard.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__What we built__\n\nAfter evaluating the UX thanks to findings from the users we built the visual elements.","childMarkdownRemark":{"html":"<p><strong>What we built</strong></p>\n<p>After evaluating the UX thanks to findings from the users we built the visual elements.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/45weObjVdY6YsukY0q0cw8/516842d59944d5f11b389599cf1d8d7b/A6.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/2eXaXsePAwEsuQsUqugMI2/ee48dff9eada8a12d0528fd4b8d4bbee/A9.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/6tl5SDhJpmWScUEEQOc6y8/316174afdad16d6ea2e513fc366d6d93/A10.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Outcome__\n\nWe saw an initial increase of registrations of the 7% compare to the same time last year. \n\n\n__Next steps and iterations__\n\nWe use analytics tools like google analytics and hotjar to collect feedback on how our users use Brave the Shave website. \n\nHotjar is a tool that allows us to visualise behaviour, understand what our users want, what they care about and what they do on the site by visually representing their clicks, taps and scrolling behaviour, which are the strongest indicators of visitor motivation and desire. \n\nThe data show us what we can do to improve the user experience also helping the UX team to identify usability issues.\n\nThe project is now live <a title=\"External link to Brave the Shave\" href=\"https://bravetheshave.macmillan.org.uk/\" target=\"_blank\">here</a>\n ","childMarkdownRemark":{"html":"<p><strong>Outcome</strong></p>\n<p>We saw an initial increase of registrations of the 7% compare to the same time last year. </p>\n<p><strong>Next steps and iterations</strong></p>\n<p>We use analytics tools like google analytics and hotjar to collect feedback on how our users use Brave the Shave website. </p>\n<p>Hotjar is a tool that allows us to visualise behaviour, understand what our users want, what they care about and what they do on the site by visually representing their clicks, taps and scrolling behaviour, which are the strongest indicators of visitor motivation and desire. </p>\n<p>The data show us what we can do to improve the user experience also helping the UX team to identify usability issues.</p>\n<p>The project is now live <a title=\"External link to Brave the Shave\" href=\"https://bravetheshave.macmillan.org.uk/\" target=\"_blank\">here</a>\n</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/1RyyJmnMD2Wu0wGYIKCSqY/e9dc2ce6968669bddc52210aff0a9d9e/Screen_Shot_2018-10-16_at_13.10.59.jpg"}}}]}},"pathContext":{"slug":"/projects/brave-the-shave/","p":"35675e68f4b5af7b995d9205ad0fc43842f16450"}}

