	module.exports = {"data":{"site":{"siteMetadata":{"title":"Annalisa Valente"}},"contentfulPageSelectorPanel":{"pages":[{"name":"Macmillan Cancer Support","title":null,"slug":"/projects/brave-the-shave/","description":"Redesigning Brave the Shave microsite"},{"name":"Google","title":"Google","slug":"/projects/google/","description":"Interaction designer contractor in the Google Play Console team"},{"name":"The Telegraph","title":"The Telegraph","slug":"/projects/the-telegraph/","description":"Working on various digital newspaper touch points"},{"name":"Nectar ","title":"Nectar","slug":"/projects/nectar/","description":"  New way of discovering Nectar brands for web and iOS-Android "},{"name":"The Telegraph puzzle ","title":null,"slug":"/projects/the-telegraph-puzzle/","description":"Redesign the experience of the Telegraph puzzle website"},{"name":"Remember names","title":null,"slug":"/projects/face-name/","description":"Concept of an Android experience that helps to match faces to names"},{"name":"MyMail & Nectar","title":"MyMail & Nectar","slug":"/projects/mymail-and-nectar/","description":"Launch of MyMail and Nectar proposition"},{"name":"Local Cancer Intelligence","title":"Local Cancer Intelligence","slug":"/projects/local-cancer-intelligence/","description":"New filter system for the LCI website"},{"name":"Mindfulness Moments","title":"Mindfulness Moments","slug":"/projects/mindfulness-moments/","description":"Building a new fundraising proposition"},{"name":"Mighty hikes","title":null,"slug":"/projects/mighty-hikes","description":"Building a new fundraising proposition"},{"name":"Calvin Klein","title":"Calvin Klein","slug":"/projects/calvin-klein/","description":"Designing microsite for Calvin Klein Italy"},{"name":"Emoji and depression","title":null,"slug":"/projects/emoji-and-depression","description":"Detect depression in young people "}]},"contentfulPage":{"slug":"/projects/calvin-klein/","password":null,"panels":[{"__typename":"ContentfulHeaderPanel","text":"Calvin Klein microsites"},{"__typename":"ContentfulContentPanel","content":{"content":"\n__Project: Find your moment__\n\n\n\nThe idea was to build a CK time crowdfunding platform. Users could contribute to it by posting pictures wearing Calvin Klein jewels on Instagram with the #ckminute hashtag.\n\nEach post would count as a minute in the crowdfunding campaign. The user contributing the 10.000th minute would win a trip to New York.\n\n__Personas__","childMarkdownRemark":{"html":"<p><strong>Project: Find your moment</strong></p>\n<p>The idea was to build a CK time crowdfunding platform. Users could contribute to it by posting pictures wearing Calvin Klein jewels on Instagram with the #ckminute hashtag.</p>\n<p>Each post would count as a minute in the crowdfunding campaign. The user contributing the 10.000th minute would win a trip to New York.</p>\n<p><strong>Personas</strong></p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/4WHHxO3lI4icCGWsEq4iY/8c7e5dee0237c81b3e6f7f4416b5a1ed/untitled3.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__User flow, user testing and visual Design__\n\nFollowing the conclusion of testing on the mid-fidelity prototype, we embarked on a high-fidelity prototype and we created the UI and a style guide.","childMarkdownRemark":{"html":"<p><strong>User flow, user testing and visual Design</strong></p>\n<p>Following the conclusion of testing on the mid-fidelity prototype, we embarked on a high-fidelity prototype and we created the UI and a style guide.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/1asKMxKKveegUA6GouSIii/66fa94cbaa6123baf01a322dcfb3885f/flow_ck_copy.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Prototyping__\n\nAfter our inItial sketching in Design Studio, we combined set of low-fidelity printed wireframes that we were able to put up on the wall and walk people through to get their reactions. We had a lot of useful feedback at this early stage and when we were satisfied that we had ironed out these issues, we then built a tappable prototype using marvel so we could take the concept out for further guerrilla testing.\n\n","childMarkdownRemark":{"html":"<p><strong>Prototyping</strong></p>\n<p>After our inItial sketching in Design Studio, we combined set of low-fidelity printed wireframes that we were able to put up on the wall and walk people through to get their reactions. We had a lot of useful feedback at this early stage and when we were satisfied that we had ironed out these issues, we then built a tappable prototype using marvel so we could take the concept out for further guerrilla testing.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/39BFlsmInuoSQcuAUkWyQ2/a833e0467705f65d703998b07a14d322/J.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/bF6GLcGuGIIKseWyqkAw4/ad72e92f57c41653fdbaa7f7ab611f20/JJ.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__Outcome__\n- More than 8.000 pictures posted on Instagram across Find your moment website\n- More than 10.000 posts shared on facebook with #ckminute hashtag around the world\n","childMarkdownRemark":{"html":"<p><strong>Outcome</strong></p>\n<ul>\n<li>More than 8.000 pictures posted on Instagram across Find your moment website</li>\n<li>More than 10.000 posts shared on facebook with #ckminute hashtag around the world</li>\n</ul>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/5f1aAFAXVmWc6CIaswm0Om/6828f64aa1d18ee397645ac3ff8d4325/flow_ck_copy_copy.jpg"}}}]}},"pathContext":{"slug":"/projects/calvin-klein/","p":"35675e68f4b5af7b995d9205ad0fc43842f16450"}}

