	module.exports = {"data":{"site":{"siteMetadata":{"title":"Annalisa Valente"}},"contentfulPageSelectorPanel":{"pages":[{"name":"Macmillan Cancer Support","title":null,"slug":"/projects/brave-the-shave/","description":"Redesigning Brave the Shave microsite"},{"name":"Google","title":"Google","slug":"/projects/google/","description":"Interaction designer contractor in the Google Play Console team"},{"name":"The Telegraph","title":"The Telegraph","slug":"/projects/the-telegraph/","description":"Working on various digital newspaper touch points"},{"name":"Nectar ","title":"Nectar","slug":"/projects/nectar/","description":"  New way of discovering Nectar brands for web and iOS-Android "},{"name":"The Telegraph puzzle ","title":null,"slug":"/projects/the-telegraph-puzzle/","description":"Redesign the experience of the Telegraph puzzle website"},{"name":"Remember names","title":null,"slug":"/projects/face-name/","description":"Concept of an Android experience that helps to match faces to names"},{"name":"MyMail & Nectar","title":"MyMail & Nectar","slug":"/projects/mymail-and-nectar/","description":"Launch of MyMail and Nectar proposition"},{"name":"Local Cancer Intelligence","title":"Local Cancer Intelligence","slug":"/projects/local-cancer-intelligence/","description":"New filter system for the LCI website"},{"name":"Mindfulness Moments","title":"Mindfulness Moments","slug":"/projects/mindfulness-moments/","description":"Building a new fundraising proposition"},{"name":"Mighty hikes","title":null,"slug":"/projects/mighty-hikes","description":"Building a new fundraising proposition"},{"name":"Calvin Klein","title":"Calvin Klein","slug":"/projects/calvin-klein/","description":"Designing microsite for Calvin Klein Italy"},{"name":"Emoji and depression","title":null,"slug":"/projects/emoji-and-depression","description":"Detect depression in young people "}]},"contentfulPage":{"slug":"/projects/mindfulness-moments/","password":null,"panels":[{"__typename":"ContentfulHeaderPanel","text":"Mindfulness Moments"},{"__typename":"ContentfulContentPanel","content":{"content":"__My role:__ UX lead\n\n__Project scope:__ Mindfulness Moment is a new product from Macmillan that help users de-stress, while raising money to care for others. \nThe user receives daily SMS tips on mindfulness in return for a cash donation at sign up. \n\n__Problem statement:__ \n\nHow can we motivate people to donate and to feel they're receiving something in return? The business objective was also to increase awareness between women from 25-60.\n\n\nWhy women and why Mindfulness?\n\nWomen are particularly susceptible to stress.\n\nWomen are socialised to be the caretakers of others. More women than men have both a career outside the home and continue to try to juggle traditional responsibilities after hours. Over 70% of married women with children under the age of 18 are employed outside the home. Sociologists describe women as struggling to achieve the \"male standard\" at work, while trying to maintain the perfect wife and mother standards at home.\n\nAs women progress through life's stages, hormonal balance associated with premenstrual, post-partum and menopausal changes can affect chemical vulnerability to stress and depression.\n\n\n\n\n__Research, analysis and testing approach__\n\n","childMarkdownRemark":{"html":"<p><strong>My role:</strong> UX lead</p>\n<p><strong>Project scope:</strong> Mindfulness Moment is a new product from Macmillan that help users de-stress, while raising money to care for others.\nThe user receives daily SMS tips on mindfulness in return for a cash donation at sign up. </p>\n<p><strong>Problem statement:</strong> </p>\n<p>How can we motivate people to donate and to feel they're receiving something in return? The business objective was also to increase awareness between women from 25-60.</p>\n<p>Why women and why Mindfulness?</p>\n<p>Women are particularly susceptible to stress.</p>\n<p>Women are socialised to be the caretakers of others. More women than men have both a career outside the home and continue to try to juggle traditional responsibilities after hours. Over 70% of married women with children under the age of 18 are employed outside the home. Sociologists describe women as struggling to achieve the \"male standard\" at work, while trying to maintain the perfect wife and mother standards at home.</p>\n<p>As women progress through life's stages, hormonal balance associated with premenstrual, post-partum and menopausal changes can affect chemical vulnerability to stress and depression.</p>\n<p><strong>Research, analysis and testing approach</strong></p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/1jeyT4K2MwKkKgI6o0goMo/2afe7d8719198a0cef71cb2b6caf20ee/A4.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"__What do we know about the users?__\n\nUnderstanding the users and their needs allowed us to build a proposition for the product. \n\nWe built two personas based on previous research.\n\n\n","childMarkdownRemark":{"html":"<p><strong>What do we know about the users?</strong></p>\n<p>Understanding the users and their needs allowed us to build a proposition for the product. </p>\n<p>We built two personas based on previous research.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/7jhVHeNs4gisqoyQcyEQeM/38a6364e8da1dd26a2df88b06d6650ce/mind_pers.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"The audience have also been tested with a smoke appeal on Facebook. \n\nThe product was tested with females with the highest propensity to give. More specifically: female G2s 25-45 (fun loving givers) and G5s 45-65 (Good lifers). We got positive feedback towards the proposition receiving 15.000 of signup.","childMarkdownRemark":{"html":"<p>The audience have also been tested with a smoke appeal on Facebook. </p>\n<p>The product was tested with females with the highest propensity to give. More specifically: female G2s 25-45 (fun loving givers) and G5s 45-65 (Good lifers). We got positive feedback towards the proposition receiving 15.000 of signup.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/29Fv9WXD008o8oGgSOqmKI/1ea2629caafecf799b4654e4b3f662c5/mind_think_feel_do.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/kSg7srJpugykiUwswO6Ua/df9b07e20110d7ff43c5277051929793/sitemap.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/1pnXPl6Nw4gmmSoIaQIOMK/cdd7e89e24944d01098d5166d65081aa/mind_ui.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/3R05sPqPA4aEAoqsiWEem2/cbb082684252948c7a2da8c441514e1f/TEST.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/6K9ApxJruEYS0mI6egqGSK/162e0d8a7674b3d5e766782ef4793fa1/icons.jpg"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/5obEEU15Qscs2Cqge466au/8926024b401d6fe6e5af0ad60010d177/website_mockup.jpg"}}},{"__typename":"ContentfulContentPanel","content":{"content":"We conducted some guerrilla testing to test the look and feel of the new product. \n\n\nThe campaign went live in jnuary: It’s the lowest CPA on a cash donation ask (around £13 Vs cause cash which was over £100)\n\nApprox. 900  registrants in 3 weeks with 7k raised.\n\n","childMarkdownRemark":{"html":"<p>We conducted some guerrilla testing to test the look and feel of the new product. </p>\n<p>The campaign went live in jnuary: It’s the lowest CPA on a cash donation ask (around £13 Vs cause cash which was over £100)</p>\n<p>Approx. 900  registrants in 3 weeks with 7k raised.</p>"}}},{"__typename":"ContentfulImagePanel","fullWidth":true,"media":{"description":"guerrilla","file":{"url":"//images.ctfassets.net/wk0hltq7eofw/bxRfio0K7m0g6iISK0oEk/986694272e11e09000b75c807183431a/unnamed__1_.png"}}}]}},"pathContext":{"slug":"/projects/mindfulness-moments/","p":"35675e68f4b5af7b995d9205ad0fc43842f16450"}}

